import React from 'react';
import { AppBar } from '@material-ui/core';

const Header = () => {
    return (
        <div>
            <AppBar position="static" color="default">
                <div className="mycontainer">
                    a
                </div>
            </AppBar>
        </div>
    )
}

export default Header;
